import React, { useState } from 'react';
import { Button, Typography, Container, Box, CssBaseline, Switch} from '@material-ui/core';
import Table from "./table";
import TextField from "./textfields";
import Toolbar from "./toolbar";
import BottomToolbar from "./bottomtoolbar";
import Snackbars from "./snackbars";
import Selector from "./selector";
import { ThemeProvider, createMuiTheme } from "@material-ui/core/styles"




function App() {
  const [darkMode, setDarkMode] =useState(false);
  const theme = createMuiTheme ({
    palette: {
      type: darkMode ? "dark" : "light",
    }
  });
  return (
<ThemeProvider theme={theme}>
  <CssBaseline />

  <Container maxWidth="sm" display="flex" justifyContent="center">
   <Button variant="outlined"><Toolbar></Toolbar></Button>
    <Switch checked={darkMode} onChange={() => setDarkMode(!darkMode)}/>
      <Box mt={1}><Typography variant="h4" gutterBottom>
        Header
      </Typography></Box>

      <TextField>

      </TextField>
      <Box mt={1} mb={2} mr={3}> <Button color="primary" variant="contained">BUTTON</Button> <Button color="secondary" variant="outlined">BUTTON</Button> </Box>



      <Box mt={3} mb={3}>

      </Box>
      <Box> <Snackbars></Snackbars></Box>
      <Box mt={1} mb={2}> <Table /> </Box>
      <BottomToolbar></BottomToolbar>
   </Container>

   </ThemeProvider>
  );


}

export default App;
